import React from "react";

import { NeuCard } from "neumorphic-ui";

function Header() {
  return (
    <div className="wrapper">
      <NeuCard width="50%" height="500px">
        <h1>HEADER</h1>
      </NeuCard>
    </div>
  );
}

export default Header;
